// src/router/AppRouter.jsx
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { AuthProvider } from '../modules/auth/AuthContext';
import { BuyerRoute, SellerRoute, AuthenticatedRoute } from '../components/ProtectedRoute';
import { Navbar } from '../components/layout/Navbar';
import { Footer } from '../components/layout/Footer';

import { HomePage } from '../pages/HomePage';
import { ShopPage } from '../pages/ShopPage';
import { CartPage } from '../pages/CartPage';
import { CheckoutPage } from '../pages/CheckoutPage';
import { LoginPage } from '../pages/LoginPage';
import { RegisterPage } from '../pages/RegisterPage';
import { RecoverPasswordPage } from '../pages/RecoverPasswordPage';
import { ProfilePage } from '../pages/ProfilePage';
import { ProductPage } from '../pages/ProductPage';
import { OrdersPage } from '../pages/OrdersPage';
import { OrderConfirmation } from '../pages/OrderConfirmation';
import { NotFoundPage } from '../pages/NotFoundPage';
import { BannerFullScreen } from '../components/ui/BannerFullScreen';
import { BuyerDashboard } from '../pages/dashboards/BuyerDashboard';
import { SellerDashboard } from '../pages/dashboards/SellerDashboard';
// 👇 Import correcto según tu archivo real
import { SellerInventory } from '../pages/seller/SellerInventory';
import { SellerOrders } from '../pages/dashboards/SellerOrders';
import { SellerStoreProfile } from '../pages/dashboards/SellerStoreProfile';
import { SellerAnalytics } from '../pages/dashboards/SellerAnalytics';
import { SellerProfile } from '../pages/SellerProfile';

export const AppRouter = () => {
    return (
        <BrowserRouter>
            <AuthProvider>
                <div className="app-container">
                    <BannerFullScreen />
                    <header>
                        <Navbar />
                    </header>

                    <main>
                        <Routes>
                            {/* ===== PÁGINAS PÚBLICAS ===== */}
                            <Route path='/' element={<HomePage />} />
                            <Route path='/home' element={<HomePage />} />

                            {/* ===== AUTENTICACIÓN ===== */}
                            <Route path='/login' element={<LoginPage />} />
                            <Route path='/register' element={<RegisterPage />} />
                            <Route path='/recuperar' element={<RecoverPasswordPage />} />

                            {/* ===== TIENDA Y PRODUCTOS (PÚBLICO/COMPRADOR) ===== */}
                            <Route path='/shop' element={<ShopPage />} />
                            {/* Slug público para detalle de producto */}
                            <Route path='/p/:slug' element={<ProductPage />} />
                            {/* Compatibilidad por ID */}
                            <Route path='/product/:id' element={<ProductPage />} />
                            {/* Rutas antiguas como categorías */}
                            <Route path='/fashion' element={<ShopPage />} />
                            <Route path='/electronic' element={<ShopPage />} />
                            <Route path='/jewellery' element={<ShopPage />} />

                            {/* ===== PERFIL DE VENDEDOR (PÚBLICO) ===== */}
                            <Route path='/seller-profile/:sellerId' element={<SellerProfile />} />

                            {/* ===== DASHBOARDS PROTEGIDOS ===== */}
                            <Route
                                path='/buyer/dashboard'
                                element={
                                    <BuyerRoute>
                                        <BuyerDashboard />
                                    </BuyerRoute>
                                }
                            />

                            <Route
                                path='/seller/dashboard'
                                element={
                                    <SellerRoute>
                                        <SellerDashboard />
                                    </SellerRoute>
                                }
                            />

                            {/* ===== RUTAS DE COMPRADOR ===== */}
                            <Route
                                path='/cart'
                                element={
                                    <BuyerRoute>
                                        <CartPage />
                                    </BuyerRoute>
                                }
                            />

                            <Route
                                path='/checkout'
                                element={
                                    <BuyerRoute>
                                        <CheckoutPage />
                                    </BuyerRoute>
                                }
                            />

                            <Route
                                path='/order-confirmation/:id?'
                                element={
                                    <BuyerRoute>
                                        <OrderConfirmation />
                                    </BuyerRoute>
                                }
                            />

                            <Route
                                path='/orders'
                                element={
                                    <BuyerRoute>
                                        <OrdersPage />
                                    </BuyerRoute>
                                }
                            />

                            <Route
                                path='/orders/:id'
                                element={
                                    <BuyerRoute>
                                        <OrdersPage />
                                    </BuyerRoute>
                                }
                            />

                            {/* ===== RUTAS DEL VENDEDOR ===== */}
                            <Route
                                path='/seller/inventory'
                                element={
                                    <SellerRoute>
                                        <SellerInventory />
                                    </SellerRoute>
                                }
                            />

                            <Route
                                path='/seller/orders'
                                element={
                                    <SellerRoute>
                                        <SellerOrders />
                                    </SellerRoute>
                                }
                            />

                            <Route
                                path='/seller/store-profile'
                                element={
                                    <SellerRoute>
                                        <SellerStoreProfile />
                                    </SellerRoute>
                                }
                            />

                            <Route
                                path='/seller/analytics'
                                element={
                                    <SellerRoute>
                                        <SellerAnalytics />
                                    </SellerRoute>
                                }
                            />

                            {/* ===== ÁREA DE USUARIO ===== */}
                            <Route
                                path='/profile'
                                element={
                                    <AuthenticatedRoute>
                                        <ProfilePage />
                                    </AuthenticatedRoute>
                                }
                            />

                            {/* ===== 404 ===== */}
                            <Route path='*' element={<NotFoundPage />} />
                        </Routes>
                    </main>

                    <Footer />
                </div>
            </AuthProvider>
        </BrowserRouter>
    );
};

export default AppRouter;
